/* this must be ran if downloading a new version of MrCheeze's repository */
function _rebuildHashList(){
	var temp=[];
	for(h in ALL_HASHES){
		var hash=_toHexInt(parseInt(h)>>>0);
		var id=ALL_HASHES[h][1];
		var type=ALL_HASHES[h][0];
		temp.push([hash,id,type]);
	}
	temp=temp.sort(function(a,b){
		if(a[1]<b[1]) return -1;
		if(a[1]>b[1]) return 1;
		return 0
	});
	
	var textarea=document.createElement('textarea');
	textarea.value='';
	for(var i=0; i<10000; i++){
		var t=temp[i];
		textarea.value+="["+t[0]+',\"'+t[1]+'\"],//'+t[2]+'\n';
	}
	document.body.appendChild(textarea);
}


function _createDebug(){
	var t=document.createElement('textarea');
	t.rows=15;
	t.style.width='75%';
	t.style.display='block';
	t.value='';
	return t
}
function _setValueByID(s,newVal){
	var results=searchHashIDs(s);
	for(var i=0; i<results.length; i++){
		var hash=results[i];
		var offset=SavegameEditor._searchHash(hash);
		tempFile.writeInt(offset+4, newVal);
	}
}
function searchHashIDs(s){
	var results=[];
	var counter=0;
	var textarea=_createDebug();
	for(var i=0; i<ALL_HASHES.length; i+=2){
		var hash=ALL_HASHES[i];
		var id=ALL_HASHES[i+1];
		if(id.indexOf(s)>=0){
		//if(id===s){
			textarea.value+=_toHexInt(hash)+',';
			if((counter+1)%8==0)
				textarea.value+='\n';
			counter++;
			results.push(hash);
		}
	}
	textarea.value+='-----\ncounter:'+counter;
	document.body.appendChild(textarea);
	return results;
}
function searchValuesByID(s){
	var hashes=searchHashIDs(s);
	
	var textarea=_createDebug();
	for(var i=0; i<hashes.length; i++){
		var hash=hashes[i];
		
		textarea.value+=_toHexInt(hash)+': ';
		var val=SavegameEditor._readFromHash(hash);
		if(typeof val === 'number'){
			textarea.value+=val;
		}else{
			textarea.value+='not found';
		}
		textarea.value+='\n';
	}
	document.body.appendChild(textarea);
}










function _toHexInt(i){var s=i.toString(16);while(s.length<8)s='0'+s;return '0x'+s}